A beautiful can for a beautiful cause. This collab was brought to fruition to bring a spotlight to and raise money for supporting women's health initiatives. It's not just the can that's special..what's inside is just as noteworthy. 
üçéüçé
A delicious blend of American, Dutch & French heirloom apples from PA & VT come together to make a superior sipping experience. With the wild yeasts, this started off funky, tart and mildly tannic? Very effervescent, had a silky feel on the tongue. As this warmed, the bubbles died down, and this gained a slight faux sweetness followed by a light sourness. The aromas reminded me of off-brand permanent marker and the inside of a plastic jug after being washed with hot water. Those smells likely have a proper term...but hell if I know. These are not (to me anyway) bad smells..they were certainly intoxicating ü•≥. 
üçéüçé
All in all... another smash hit from both of these places...just a fantastic cider. 
